import React from "react";
import { useNavigate } from "react-router-dom";


export default function Graph_Result(props) {
    const navigate = useNavigate();
    const pierecord = props.custom_data && props.custom_data.map((item) => {
        return ({ name: item.name, profit: item.profit });
    });

    function Display(item) {
        return (
            <>
                <h1>{item.name}</h1>
                <br />
                <h2>Weather</h2>
                <p>{item.weather}</p>
                <br />
                <h2>Seed Type</h2>
                <p>{item.seed}</p>
                <br />
                <h2>Fetilizers Used</h2>
            </>
        )
    }

    return (
        <div>
            {props.custom_data && props.custom_data.map((item) => <Display name={item.name} weather={item.weather} seed={item.seed} fertlizer={item.fertlizer} />)}
        </div>
    )
}
